import React, {Component} from "react";

export default class UserFormComponent extends Component{

    constructor(props) {
        super(props);
        this.onChangeUsername = this.onChangeUsername.bind(this);
        this.onChangePassword = this.onChangePassword.bind(this);
        this.onChangeReEnterPassword = this.onChangeReEnterPassword.bind(this);
        this.onChangeRole = this.onChangeRole.bind(this);
        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            
        };

    }



    render() {
        return(
            <div className="container">
                <h1>User Form</h1>
                <form className="form-horizontal">
                    <div className="form-group">
                        <label className="font-weight-bold">Username</label>
                        <div>
                            <input type="text" className="form-control"/>
                        </div>
                    </div>
                    <div className="form-group">
                        <label className="font-weight-bold">Password</label>
                        <div>
                            <input type="password" className="form-control"/>
                        </div>
                    </div>
                    <div className="form-group">
                        <label className="font-weight-bold">Re Enter Password</label>
                        <div>
                            <input type="password" className="form-control"/>
                        </div>
                    </div>
                    <div className="form-group">
                        <label className="font-weight-bold">Role</label>
                        &#x00A0;&#x00A0;&#x00A0;&#x00A0;&#x00A0;&#x00A0;
                        <label><input value="Administrator" type="radio" name="role"/> Administrator</label>
                        &#x00A0;&#x00A0;&#x00A0;
                        <label><input value="Customer" type="radio" name="role"/> Customer</label>
                    </div>
                    <div className="text-right">
                        <button className="btn btn-primary">Add</button>
                    </div>
                </form>
            </div>
        );
    }
}
